import "./Dapp.css";
import styled from "styled-components";
import { BunnyCard } from "./components/bunnyCard";
import { UnlockButton } from "./components/ConnectWalletButton/UnlockButton";



const AppContainer = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: #0f0c0d;
`;

function App() {
  return (

    <AppContainer>
        <UnlockButton/>
      <BunnyCard />
    </AppContainer>
  );
}

export default App;
